    value: 'To:  Federal Election Commission - the Mid-Year report for the period
      ending 6/30/01 is being amended in spite of the fact that the review was done
      on the End of Year report from 2001.  The errors cited in Colleen Mannings review
      dealt with incorrect balances in the Mid-Year report  that were carried forward
      to the End of Year report.  Therefore'
  - value: ' as per Collen Mannings instructions we are amending the Mid-Year report.  One
      of the comments on the review dealt with the time period of contributions through
      payroll.  To be specific'
  - value: ' we were told that the description Every Pay Period  needed to be changed
      to Bi-Monthly.  We have contacted our software company and they are in the process
      of researching how to accomplish this.  If there are any problems with this
      amendment'
  - value: ' please contact Jay Van Quathem at (602) 808-7869.'
